package com.example.moviesapp;

import androidx.test.ext.junit.runners.AndroidJUnit4;

import com.example.moviesapp.models.EntityFilm;
import com.example.moviesapp.models.FilmModel;

import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;

import java.util.ArrayList;

import static org.junit.Assert.assertEquals;

@RunWith(AndroidJUnit4.class)
public class modelTests {

    private FilmModel model;
    private EntityFilm film;
    private String id;

    @Before
    public void setUp() {
        model = new FilmModel();
        film = new EntityFilm();
        film.setId("1");
        film.setRate("3");
        film.setPhoto("");
        film.setTitle("Harry Potter y la piedra filosofal");
        film.setSynopsis("Nuevo mago");
        film.setDirector("Alvaro");
        film.setDate("15/06/1997");
        film.setWatched(true);
        film.setGenre("Fantasy");
        model.insert(film);
        this.id = model.getAllSummarize().get(0).getId();
    }

    @Test
    public void insertFilm() {
        assertEquals(true, this.model.insert(this.film));
    }

    @Test
    public void updateFilm() {
        this.film.setWatched(false);
        assertEquals(true, this.model.updateFilm(this.film));
    }

    @Test
    public void getAll() {
        assertEquals(this.film.getTitle(), this.model.getAllSummarize().get(0).getTitle());
    }

    @Test
    public void getFilmById() {
        assertEquals(this.id, this.model.getById(this.id).getId());
        assertEquals(this.film.getTitle(), this.model.getById(this.id).getTitle());
    }

    @Test
    public void getGenres() {
        ArrayList<String> categories = new ArrayList<>();
        categories.add("Fantasy");
        categories.add("Action");
        categories.add("HP");
        assertEquals(categories, this.model.getAllGenres());
    }

    @Test
    public void deleteFilm() {
        assertEquals(true, this.model.deleteFilm(this.film));
    }

    @Test
    public void searchFilm() {
        ArrayList<EntityFilm> films = new ArrayList<>();
        films.add(this.film);
        assertEquals(0, FilmModel.getItemsByAllCriterions("Fantasy", "30/11/2001", "Paco").size());
        assertEquals(0, FilmModel.getItemsByTitle("Rataton").size());
        assertEquals(0, FilmModel.getItemsByDate("31/2/1995").size());
        assertEquals(0, FilmModel.getItemsByGenre("family").size());
        assertEquals(0, FilmModel.getItemsByDate("1/01/1990").size());
    }
}
